import React from "react";

function UserInitializer({ onUserSelect }) {
  const handleUserSelect = (userId) => {
    // Gửi thông tin của người dùng đã chọn lên component cha
    if (onUserSelect) {
      onUserSelect(userId);
    }
  };
  return (
    <div className="user-initializer">
      <button className="user" onClick={() => handleUserSelect("User 1")}>
        User 1
      </button>
      <button className="user" onClick={() => handleUserSelect("User 2")}>
        User 2
      </button>
      <button className="user" onClick={() => handleUserSelect("User 3")}>
        User 3
      </button>
    </div>
  );
}

export default UserInitializer;
